<body>
  <main>
    <h1>Welcome to My Website</h1>
  </main>
  <div id="docmap" style="position: absolute; display: none;padding-left:5px" class="docmap1 ui-widget">
    <div id="lnkMenu" class="ysh_btn_right " style="float: left; width: 60px; margin: 3px 5px 2px 2px;">Menu</div>
    <div style="float:left;margin-left:20px;width:200px;color:white;margin-top:3px">
      <div style="float:left;width:40px">Name:</div>
      <div id="lbDoc"
        style="width:160px;height:14px;float:left;cursor:pointer;text-decoration:underline;overflow:hidden"></div>
      <select id="ddlDoc" class="EntryField" style="display:none;max-width:150px"></select>
      <div style="float:left;width:40px">Page:</div>
      <div id="lbPage" style="width: 160px; float: left; cursor: pointer; text-decoration: underline"></div><select
        id="ddlPage" class="EntryField" style="max-width:150px; margin-top: 1px;display:none"></select>
    </div>
    <div style="float: left; margin-left: 20px; width: 500px; height: 85%; margin-top: 3px">
      <div id="divMsg" class="ui-widget ui-corner-all"
        style="display:none;padding:0px 8px 0px 8px;width:100%;height:100%;background-color:white;color:red">

      </div>
    </div>
    <div style="float:right;width:200px;padding-top:2px">
      <div style="width: 12px; height: 12px; background-color: rgb(255, 132, 153); float: left"></div>&nbsp;<span
        style="color: white">Required fields</span>
      <img style="width:30px" src="images/ysh_arrow.png" alt="" />&nbsp;<span style="color:white">Signatures</span>
      <div style="padding-top:1px"><img style="width:12px" src="images/initial.png" alt="" />&nbsp;<span
          style="color:white">Initials (click on a field to sign)</span></div>
    </div>
  </div>
  <div id="divWind" style="width:1140px;margin-top:1px">
    <div id="divprnt" style="overflow:auto;height:100%;width:100%">
        <div id='docarea' style="position: absolute; float: left;">
            
        </div>
    </div>

    <div id="divMenu" style="display:none;position:absolute;bottom:-90px;left:10px;width:60px;height:100px">
        <div id="lnkHelp" class="ysh_btn mnubtn">Help</div>
        <div id="lnkDownload" class="ysh_btn mnubtn">Download</div>
        <div id="lnkAttach" class="ysh_btn mnubtn">Attach File</div>
        <div id="lnkSave" class="ysh_btn mnubtn">Save</div>
    </div>
</div>
